import React, { useState } from 'react';

function App(props) {
    const [status, setstatus] = useState(0);
    return (
        <div>
            <form action="http://127.0.0.1:3000/values" method="POST">
                <a>Enter the name:</a>
                <input type="text" name={(name) => setstatus(name)}></input>
                <button type="submit">Submit</button>
            </form>
        </div>
    );
}

export default App;
